;"use strict";$.editable.addInputType("time",{element:function(f,d){for(var e,b=$('<select id="hour_" />'),h=$('<select id="min_" />'),a=0;a<=23;a++){a<10&&(a="0"+a),e=$("<option />").val(a).append(a),b.append(e)}$(this).append(b);for(var c=0;c<=45;c=parseInt(c,10)+15){c<10&&(c="0"+c),e=$("<option />").val(c).append(c),h.append(e)}$(this).append(h);var g=$('<input type="hidden" />');return $(this).append(g),g},content:function(b,e,d){var a=parseInt(b.substr(0,2),10),c=parseInt(b.substr(3,2),10);$("#hour_",this).children().each(function(){a===$(this).val()&&$(this).attr("selected","selected")}),$("#min_",this).children().each(function(){c===$(this).val()&&$(this).attr("selected","selected")})},submit:function(b,a){var c=$("#hour_").val()+":"+$("#min_").val();$("input",this).val(c)}});